import React, {Component} from 'react';
import viewStyle from './index.module.css';

class View extends Component {
    render() {
        return (
            <div className={viewStyle.box}>
                <h3 className={viewStyle.header}>企业管理数据魔墙</h3>
            </div>
        );
    }
}

export default View;
